import { getCrmebCopyRight } from '@/api/system';
export default {
  name: 'i-copyright',
  data: function data() {
    return {
      links: [{
        title: '官网',
        key: '官网',
        href: 'https://www.higoshop.net',
        blankTarget: true
      }, {
        title: '社区',
        key: '社区',
        href: 'http://q.higoshop.net',
        blankTarget: true
      }, {
        title: '文档',
        key: '文档',
        href: 'http://doc.higoshop.net',
        blankTarget: true
      }],
      copyright: ''
    };
  },
  mounted: function mounted() {
    this.getCopyRight();
  },
  methods: {
    //获取版权信息
    getCopyRight: function getCopyRight() {
      var _this = this;

      getCrmebCopyRight().then(function (res) {
        var copyrightText = res.data.copyrightContext ? res.data.copyrightContext : 'Copyright © 2012 -2023 HIGOSHOP助力中小微企业数字化运营';

        _this.$store.dispatch('admin/db/get', {
          dbName: 'sys',
          path: 'user.info',
          user: true
        }).then(function (res) {
          copyrightText += res.version ? '  |  ' + res.version : '';
          _this.copyright = copyrightText;
        });
      });
    }
  }
};
